//IMAGEN
import ImgNovia from "../assets/Images/imgnovia.jpg"
import ImgNadando from "../assets/Images/ImgNadando.jpg"
import ImgRisco from "../assets/Images/risco.jpg"
import ImgPlaya from "../assets/Images/playa.jpg"
import ImgCatarata from "../assets/Images/catarata.jpg"
import ImgNeblina from "../assets/Images/neblina.jpg"
import ImgParis from "../assets/Images/paris.jpg"
import ImgBosque from "../assets/Images/bosque.jpg"
import ImgRisco2 from "../assets/Images/risco2.jpg"

//Iconos
import iconFacebook from "../assets/Icons/facebook.png"
import iconInstagram from "../assets/Icons/instagram.png"
import iconSnapchat from "../assets/Icons/snapchat.png"
import iconPinterest from "../assets/Icons/pinterest.png"
import icontwitter from "../assets/Icons/twitter.png"
import iconLinkedin from "../assets/Icons/"

const Imagen = {
    imgnovia: ImgNovia,
    imgnadando: ImgNadando,
    imgrisco: ImgRisco,
    imgplaya: ImgPlaya,
    imgcatarata: ImgCatarata,
    imgneblina: ImgNeblina,
    imgparis: ImgParis,
    imgbosque: ImgBosque,
    imgrisco2:ImgRisco2
};

export const themes = {
    light: {
        imagen:Imagen
    }
};
